import './App.css';
import Home from './screens/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <Router>
      <Routes>
        <Route exact path='/'/>
    </Routes>
    </Router>
  );
}

export default App;
